import React from 'react';
import IconButton from './IconButton';

const Footer = () => {
  return (
    <div className="hero-foot">
    <IconButton url="../../../public/images/sad_smiley.png" />
    <IconButton url="../../../public/images/smile.png" />
    </div>)
}

export default Footer;
